<body>
報告未使用的類型參數。
<pre><code>func main() {
 printAll(
  42,
  "bird",
 )
}

func printAll[I int, S string](
 i I,
 s string,
) {
 fmt.Println(i)
 fmt.Println(s)
}</code></pre>
<p><b>printAll</b> 函式具有兩個類型參數 <code>I</code> 和 <code>S</code>，但是僅使用其中的第一個參數。
  因此，<code>S string</code> 將被灰顯。
</p>
